import React from "react";

function Login() {
  return (
    <div className="container-fluid">
      <div className="row middle">
        <div class="col-12 col-md-6 title-section">
          <div class="container">
            <div class="row">
              <div class="col">
                <div class="text-center" style={{ paddingTop: "30px" }}>
                  <h1>ActiveAt</h1>
                  <p id="tagline"></p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Login;
